// NewMockIConcurrent creates a new instance of MockIConcurrent. It also registers a testing interface on the mock and a cleanup function to assert the mocks expectations.
// The first argument is typically a *testing.T value.
func NewMockIConcurrent(t interface {
	mock.TestingT
	Cleanup(func())
}) *MockIConcurrent {
	mock := &MockIConcurrent{}
	mock.Mock.Test(t)

	t.Cleanup(func() { mock.AssertExpectations(t) })

	return mock
}
